@testset "4.3.4.2 (a+b tan)^m (c+d tan)^n (A+B tan+C tan^2)" begin
    (A, B, C, a, b, c, d, e, f, m, n, x, ) = @variables A B C a b c d e f m n x

    #= ::Package:: =#

    #= ::Title:: =#
    #=Integrands*of*the*form*(a+b*tan(e+f*x))^m*(c+d*tan(e+f*x))^n*(A+B*tan(e+f*x)+C*tan(e+f*x)^2)=#


    #= ::Section::Closed:: =#
    #=Integrands*of*the*form*(a+b*tan(e+f*x))^m*tan(e+f*x)^n*(A+B*tan(e+f*x)+C*tan(e+f*x)^2)=#


    #= ::Subsection::Closed:: =#
    #=Integrands*of*the*form*tan(e+f*x)^m*(B*tan(e+f*x)+C*tan(e+f*x)^2)*(a+b*tan(e+f*x))^n=#


    #= ::Subsubsection::Closed:: =#
    #=n>0=#


    @test_int [tan(c + d*x)^1*(a + b*tan(c + d*x))*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 5, -((a*B - b*C)*x) + ((b*B + a*C)*log(cos(c + d*x)))/d + ((a*B - b*C)*tan(c + d*x))/d + ((b*B + a*C)*tan(c + d*x)^2)/(2*d) + (b*C*tan(c + d*x)^3)/(3*d)]
    @test_int [tan(c + d*x)^0*(a + b*tan(c + d*x))*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 3, -((b*B + a*C)*x) - ((a*B - b*C)*log(cos(c + d*x)))/d + (b*B*tan(c + d*x))/d + (C*(a + b*tan(c + d*x))^2)/(2*b*d)]
    @test_int [cot(c + d*x)^1*(a + b*tan(c + d*x))*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 3, (a*B - b*C)*x - ((b*B + a*C)*log(cos(c + d*x)))/d + (b*C*tan(c + d*x))/d]
    @test_int [cot(c + d*x)^2*(a + b*tan(c + d*x))*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 5, (b*B + a*C)*x - (b*C*log(cos(c + d*x)))/d + (a*B*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^3*(a + b*tan(c + d*x))*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 4, -((a*B - b*C)*x) - (a*B*cot(c + d*x))/d + ((b*B + a*C)*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^4*(a + b*tan(c + d*x))*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 5, -((b*B + a*C)*x) - ((b*B + a*C)*cot(c + d*x))/d - (a*B*cot(c + d*x)^2)/(2*d) - ((a*B - b*C)*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^5*(a + b*tan(c + d*x))*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 6, (a*B - b*C)*x + ((a*B - b*C)*cot(c + d*x))/d - ((b*B + a*C)*cot(c + d*x)^2)/(2*d) - (a*B*cot(c + d*x)^3)/(3*d) - ((b*B + a*C)*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^6*(a + b*tan(c + d*x))*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 7, (b*B + a*C)*x + ((b*B + a*C)*cot(c + d*x))/d + ((a*B - b*C)*cot(c + d*x)^2)/(2*d) - ((b*B + a*C)*cot(c + d*x)^3)/(3*d) - (a*B*cot(c + d*x)^4)/(4*d) + ((a*B - b*C)*log(sin(c + d*x)))/d]


    @test_int [tan(c + d*x)^1*(a + b*tan(c + d*x))^2*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 6, -((a^2*B - b^2*B - 2*a*b*C)*x) + ((2*a*b*B + a^2*C - b^2*C)*log(cos(c + d*x)))/d - (b*(b*B + a*C)*tan(c + d*x))/d - (C*(a + b*tan(c + d*x))^2)/(2*d) + ((4*b*B - a*C)*(a + b*tan(c + d*x))^3)/(12*b^2*d) + (C*tan(c + d*x)*(a + b*tan(c + d*x))^3)/(4*b*d)]
    @test_int [tan(c + d*x)^0*(a + b*tan(c + d*x))^2*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 4, -((2*a*b*B + a^2*C - b^2*C)*x) - ((a^2*B - b^2*B - 2*a*b*C)*log(cos(c + d*x)))/d + (b*(a*B - b*C)*tan(c + d*x))/d + (B*(a + b*tan(c + d*x))^2)/(2*d) + (C*(a + b*tan(c + d*x))^3)/(3*b*d)]
    @test_int [cot(c + d*x)^1*(a + b*tan(c + d*x))^2*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 4, (a^2*B - b^2*B - 2*a*b*C)*x - ((2*a*b*B + a^2*C - b^2*C)*log(cos(c + d*x)))/d + (b*(b*B + a*C)*tan(c + d*x))/d + (C*(a + b*tan(c + d*x))^2)/(2*d)]
    @test_int [cot(c + d*x)^2*(a + b*tan(c + d*x))^2*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 5, (2*a*b*B + a^2*C - b^2*C)*x - (b*(b*B + 2*a*C)*log(cos(c + d*x)))/d + (a^2*B*log(sin(c + d*x)))/d + (b^2*C*tan(c + d*x))/d]
    @test_int [cot(c + d*x)^3*(a + b*tan(c + d*x))^2*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 5, -((a^2*B - b^2*B - 2*a*b*C)*x) - (a^2*B*cot(c + d*x))/d - (b^2*C*log(cos(c + d*x)))/d + (a*(2*b*B + a*C)*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^4*(a + b*tan(c + d*x))^2*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 5, (b^2*C - a*(2*b*B + a*C))*x - (a*(2*b*B + a*C)*cot(c + d*x))/d - (a^2*B*cot(c + d*x)^2)/(2*d) - ((a^2*B - b^2*B - 2*a*b*C)*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^5*(a + b*tan(c + d*x))^2*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 6, (a^2*B - b^2*B - 2*a*b*C)*x + ((a^2*B - b^2*B - 2*a*b*C)*cot(c + d*x))/d - (a*(2*b*B + a*C)*cot(c + d*x)^2)/(2*d) - (a^2*B*cot(c + d*x)^3)/(3*d) + ((b^2*C - a*(2*b*B + a*C))*log(sin(c + d*x)))/d]
    @test_int [cot(c + d*x)^6*(a + b*tan(c + d*x))^2*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 7, (2*a*b*B + a^2*C - b^2*C)*x - ((b^2*C - a*(2*b*B + a*C))*cot(c + d*x))/d + ((a^2*B - b^2*B - 2*a*b*C)*cot(c + d*x)^2)/(2*d) - (a*(2*b*B + a*C)*cot(c + d*x)^3)/(3*d) - (a^2*B*cot(c + d*x)^4)/(4*d) + ((a^2*B - b^2*B - 2*a*b*C)*log(sin(c + d*x)))/d]


    @test_int [tan(c + d*x)^0*(a + b*tan(c + d*x))^3*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 5, -((3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*x) - ((a^3*B - 3*a*b^2*B - 3*a^2*b*C + b^3*C)*log(cos(c + d*x)))/d + (b*(a^2*B - b^2*B - 2*a*b*C)*tan(c + d*x))/d + ((a*B - b*C)*(a + b*tan(c + d*x))^2)/(2*d) + (B*(a + b*tan(c + d*x))^3)/(3*d) + (C*(a + b*tan(c + d*x))^4)/(4*b*d)]
    @test_int [cot(c + d*x)^1*(a + b*tan(c + d*x))^3*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 5, (a^3*B - 3*a*b^2*B - 3*a^2*b*C + b^3*C)*x - ((3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*log(cos(c + d*x)))/d + (b*(2*a*b*B + a^2*C - b^2*C)*tan(c + d*x))/d + ((b*B + a*C)*(a + b*tan(c + d*x))^2)/(2*d) + (C*(a + b*tan(c + d*x))^3)/(3*d)]
    @test_int [cot(c + d*x)^2*(a + b*tan(c + d*x))^3*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 6, (3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*x - (b*(3*a*b*B + 3*a^2*C - b^2*C)*log(cos(c + d*x)))/d + (a^3*B*log(sin(c + d*x)))/d + (b^2*(b*B + 2*a*C)*tan(c + d*x))/d + (b*C*(a + b*tan(c + d*x))^2)/(2*d)]
    @test_int [cot(c + d*x)^3*(a + b*tan(c + d*x))^3*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 6, -((a^3*B - 3*a*b^2*B - 3*a^2*b*C + b^3*C)*x) - (b^2*(b*B + 3*a*C)*log(cos(c + d*x)))/d + (a^2*(3*b*B + a*C)*log(sin(c + d*x)))/d + (b^2*(a*B + b*C)*tan(c + d*x))/d - (a*B*cot(c + d*x)*(a + b*tan(c + d*x))^2)/d]
    @test_int [cot(c + d*x)^4*(a + b*tan(c + d*x))^3*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 6, -((3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*x) - (a^2*(2*b*B + a*C)*cot(c + d*x))/d - (b^3*C*log(cos(c + d*x)))/d - (a*(a^2*B - 3*b^2*B - 3*a*b*C)*log(sin(c + d*x)))/d - (a*B*cot(c + d*x)^2*(a + b*tan(c + d*x))^2)/(2*d)]
    @test_int [cot(c + d*x)^5*(a + b*tan(c + d*x))^3*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 6, (a^3*B - 3*a*b^2*B - 3*a^2*b*C + b^3*C)*x + (a*(3*a^2*B - 8*b^2*B - 9*a*b*C)*cot(c + d*x))/(3*d) - (a^2*(5*b*B + 3*a*C)*cot(c + d*x)^2)/(6*d) - ((3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*log(sin(c + d*x)))/d - (a*B*cot(c + d*x)^3*(a + b*tan(c + d*x))^2)/(3*d)]
    @test_int [cot(c + d*x)^6*(a + b*tan(c + d*x))^3*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 7, (3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*x + ((3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*cot(c + d*x))/d + (a*(2*a^2*B - 5*b^2*B - 6*a*b*C)*cot(c + d*x)^2)/(4*d) - (a^2*(3*b*B + 2*a*C)*cot(c + d*x)^3)/(6*d) + ((a^3*B - 3*a*b^2*B - 3*a^2*b*C + b^3*C)*log(sin(c + d*x)))/d - (a*B*cot(c + d*x)^4*(a + b*tan(c + d*x))^2)/(4*d)]
    @test_int [cot(c + d*x)^7*(a + b*tan(c + d*x))^3*(B*tan(c + d*x) + C*tan(c + d*x)^2), x, 8, -((a^3*B - 3*a*b^2*B - 3*a^2*b*C + b^3*C)*x) - ((a^3*B - 3*a*b^2*B - 3*a^2*b*C + b^3*C)*cot(c + d*x))/d + ((3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*cot(c + d*x)^2)/(2*d) + (a*(5*a^2*B - 12*b^2*B - 15*a*b*C)*cot(c + d*x)^3)/(15*d) - (a^2*(7*b*B + 5*a*C)*cot(c + d*x)^4)/(20*d) + ((3*a^2*b*B - b^3*B + a^3*C - 3*a*b^2*C)*log(sin(c + d*x)))/d - (a*B*cot(c + d*x)^5*(a + b*tan(c + d*x))^2)/(5*d)]


    #= ::Subsubsection::Closed:: =#
    #=n<0=#


    @test_int [tan(c + d*x)^2*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x)), x, 7, -(((b*B - a*C)*x)/(a^2 + b^2)) + ((a*B + b*C)*log(cos(c + d*x)))/((a^2 + b^2)*d) - (a^3*(b*B - a*C)*log(a + b*tan(c + d*x)))/(b^3*(a^2 + b^2)*d) + ((b*B - a*C)*tan(c + d*x))/(b^2*d) + (C*tan(c + d*x)^2)/(2*b*d)]
    @test_int [tan(c + d*x)^1*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x)), x, 6, -(((a*B + b*C)*x)/(a^2 + b^2)) - ((b*B - a*C)*log(cos(c + d*x)))/((a^2 + b^2)*d) + (a^2*(b*B - a*C)*log(a + b*tan(c + d*x)))/(b^2*(a^2 + b^2)*d) + (C*tan(c + d*x))/(b*d)]
    @test_int [tan(c + d*x)^0*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x)), x, 6, ((b*B - a*C)*x)/(a^2 + b^2) - ((a*B + b*C)*log(cos(c + d*x)))/((a^2 + b^2)*d) - (a*(b*B - a*C)*log(a + b*tan(c + d*x)))/(b*(a^2 + b^2)*d)]
    @test_int [cot(c + d*x)^1*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x)), x, 3, ((a*B + b*C)*x)/(a^2 + b^2) + ((b*B - a*C)*log(a*cos(c + d*x) + b*sin(c + d*x)))/((a^2 + b^2)*d)]
    @test_int [cot(c + d*x)^2*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x)), x, 4, -(((b*B - a*C)*x)/(a^2 + b^2)) + (B*log(sin(c + d*x)))/(a*d) - (b*(b*B - a*C)*log(a*cos(c + d*x) + b*sin(c + d*x)))/(a*(a^2 + b^2)*d)]
    @test_int [cot(c + d*x)^3*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x)), x, 5, -(((a*B + b*C)*x)/(a^2 + b^2)) - (B*cot(c + d*x))/(a*d) - ((b*B - a*C)*log(sin(c + d*x)))/(a^2*d) + (b^2*(b*B - a*C)*log(a*cos(c + d*x) + b*sin(c + d*x)))/(a^2*(a^2 + b^2)*d)]
    @test_int [cot(c + d*x)^4*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x)), x, 6, ((b*B - a*C)*x)/(a^2 + b^2) + ((b*B - a*C)*cot(c + d*x))/(a^2*d) - (B*cot(c + d*x)^2)/(2*a*d) - ((a^2*B - b^2*B + a*b*C)*log(sin(c + d*x)))/(a^3*d) - (b^3*(b*B - a*C)*log(a*cos(c + d*x) + b*sin(c + d*x)))/(a^3*(a^2 + b^2)*d)]


    @test_int [tan(c + d*x)^2*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x))^2, x, 7, -(((2*a*b*B - a^2*C + b^2*C)*x)/(a^2 + b^2)^2) + ((a^2*B - b^2*B + 2*a*b*C)*log(cos(c + d*x)))/((a^2 + b^2)^2*d) + (a^2*(a^2*b*B + 3*b^3*B - 2*a^3*C - 4*a*b^2*C)*log(a + b*tan(c + d*x)))/(b^3*(a^2 + b^2)^2*d) - ((a*b*B - 2*a^2*C - b^2*C)*tan(c + d*x))/(b^2*(a^2 + b^2)*d) + (a*(b*B - a*C)*tan(c + d*x)^2)/(b*(a^2 + b^2)*d*(a + b*tan(c + d*x)))]
    @test_int [tan(c + d*x)^1*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x))^2, x, 6, -(((a^2*B - b^2*B + 2*a*b*C)*x)/(a^2 + b^2)^2) - ((2*a*b*B - a^2*C + b^2*C)*log(cos(c + d*x)))/((a^2 + b^2)^2*d) - (a*(2*b^3*B - a^3*C - 3*a*b^2*C)*log(a + b*tan(c + d*x)))/(b^2*(a^2 + b^2)^2*d) - (a^2*(b*B - a*C))/(b^2*(a^2 + b^2)*d*(a + b*tan(c + d*x)))]
    @test_int [tan(c + d*x)^0*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x))^2, x, 3, ((2*a*b*B - a^2*C + b^2*C)*x)/(a^2 + b^2)^2 - ((a^2*B - b^2*B + 2*a*b*C)*log(a*cos(c + d*x) + b*sin(c + d*x)))/((a^2 + b^2)^2*d) + (a*(b*B - a*C))/(b*(a^2 + b^2)*d*(a + b*tan(c + d*x)))]
    @test_int [cot(c + d*x)^1*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x))^2, x, 4, ((a^2*B - b^2*B + 2*a*b*C)*x)/(a^2 + b^2)^2 + ((2*a*b*B - a^2*C + b^2*C)*log(a*cos(c + d*x) + b*sin(c + d*x)))/((a^2 + b^2)^2*d) - (b*B - a*C)/((a^2 + b^2)*d*(a + b*tan(c + d*x)))]
    @test_int [cot(c + d*x)^2*(B*tan(c + d*x) + C*tan(c + d*x)^2)/(a + b*tan(c + d*x))^2, x, 5, -(((2*a*b*B - a^2*C + b^2*C)*x)/(a^2 + b^2)^2) + (B*log(sin(c + d*x)))/(a^2*d) - (b*(3*a^2*b*B + b^3*B - 2*a^3*C)*log(a*cos(c + d*x) + b*sin(c + d*x)))/(a^2*(a^2 + b^2)^2*d) + (b*(b*B - a*C))/(a*(a^2 + b^2)*d*(a + b*tan(c + d*x)))]
